  chinese-poetry-authors:
    李璟:
      str: 李璟（916－961年8月12日），即南唐元宗，初名景通，曾更名瑶，字伯玉。徐州彭城（今江苏徐州）人，南唐烈祖李昪长子，五代十国时期南唐第二位皇帝，于943年嗣位。后因受到后周威胁，削去帝号，改称国主，史称南唐中主。\n李璟即位后开始大规模对外用兵，消灭楚、闽二国。他在位时，南唐疆土最大。不过李璟奢侈无度，导致政治腐败，国力下降，被后周夺取淮南江北之地，遂从金陵迁都洪州，称南昌府。961年逝世于南昌，时年四十六岁，葬顺陵。死后获宗主国宋朝特许而被追上庙号元宗，谥号明道崇德文宣孝皇帝。其诗词被收录《南唐二主词》中。\n李璟好读书，多才艺。常与宠臣韩熙载、冯延巳等饮宴赋诗。他的词，感情真挚，风格清新，语言不事雕琢，“小楼吹彻玉笙寒”是流芳千古的名句。
    李煜:
      str: 李煜（937年8月15日―978年8月13日），南唐元宗（即南唐中主）李璟第六子，初名从嘉，字重光，号钟隐、莲峰居士，汉族，生于金陵（今江苏南京），祖籍彭城（今江苏徐州铜山区），南唐最后一位国君。\n北宋建隆二年（961年），李煜继位，尊宋为正统，岁贡以保平安。开宝四年（971年）十月，宋太祖灭南汉，李煜去除唐号，改称“江南国主”。次年，贬损仪制，撤去金陵台殿鸱吻以示尊奉宋廷。开宝八年（975年），李煜兵败降宋，被俘至汴京（今河南开封），授右千牛卫上将军，封违命侯。太平兴国三年（978年）七月七日，李煜死于汴京，追赠太师，追封吴王。世称南唐后主、李后主。\n李煜精书法、工绘画、通音律，诗文均有一定造诣，尤以词的成就最高。李煜的词，继承了晚唐以来温庭筠、韦庄等花间派词人的传统，又受李璟、冯延巳等的影响，语言明快、形象生动、用情真挚，风格鲜明，其亡国后词作更是题材广阔，含意深沉，在晚唐五代词中别树一帜，对后世词坛影响深远。
